import React, {useState, useEffect} from "react";
import SeasonalItem from "./SeasonalItem.jsx";
import CoffeeHangOut from "../images/hang-out.svg"

function Feature(){
        return (
            <div className="container mx-auto h-screen md:grid md:grid-cols-2 md:gap-5 md:grid-rows-2 md:grid-flow-col">
                <div className="md:flex items-center">
                    <h1 className="font-semibold my-4 text-center md:text-center-none md:transform text-5xl md:text-7xl md:row-span-2">Freshly <span className="text-yellow-800">Roasted.</span> Downtown <span className="text-yellow-400">Feel.</span></h1>
                </div>
                <div className="container md:flex md:items-start md:justiy-items-start">
                    <button className="bg-yellow-900 text-white text-2xl w-1/2 md:w-full h-auto rounded-xl md:row-span-1 mx-32 my-2 p-3">Explore Fausto</button>
                </div>
                <div className="md:flex items-center md:row-span-2 md:p-2">
                    <img className="w-full h-auto mt-2 " src={CoffeeHangOut} alt="coffee-hang-out" />
                </div>
            </div>
        )
}

export default Feature;
